var title_f19_23_19836="Cotswolds system in HL";
var content_f19_23_19836=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F66651&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F66651&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cotswolds staging classification for Hodgkin lymphoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stage I",
"        </strong>",
"        - Involvement of a single lymph node region (eg, cervical, axillary, inguinal, mediastinal) or lymphoid structure such as the spleen, thymus, or Waldeyer's ring.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stage II",
"        </strong>",
"        - Involvement of two or more lymph node regions or lymph node structures on the same side of the diaphragm. Hilar nodes should be considered to be \"lateralized\" and when involved on both sides, constitute stage II disease. For the purpose of defining the number of anatomic regions, all nodal disease within the mediastinum is considered to be a single lymph node region, and hilar involvement constitutes an additional site of involvement. The number of anatomic regions should be indicated by a subscript (eg, II-3).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stage III",
"        </strong>",
"        - Involvement of lymph node regions or lymphoid structures on both sides of the diaphragm. This may be subdivided stage III-1 or III-2: stage III-1 is used for patients with involvement of the spleen or splenic hilar, celiac, or portal nodes; and stage III-2 is used for patients with involvement of the paraaortic, iliac, inguinal, or mesenteric nodes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stage IV",
"        </strong>",
"        - Diffuse or disseminated involvement of one or more extranodal organs or tissue beyond that designated E, with or without associated lymph node involvement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All cases are subclassified to indicate the absence (A) or presence (B) of the systemic symptoms of significant unexplained fever, night sweats, or unexplained weight loss exceeding 10 percent of body weight during the six months prior to diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The designation \"E\" refers to extranodal contiguous extension (ie, proximal or contiguous extranodal disease) that can be encompassed within an irradiation field appropriate for nodal disease of the same anatomic extent. More extensive extranodal disease is designated stage IV.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The subscript \"X\" is used if bulky disease is present. This is defined as a mediastinal mass with a maximum width that is equal to or greater than one-third of the internal transverse diameter of the thorax at the level of T5/6 interspace or &gt;10 cm maximum dimension of a nodal mass. No subscripts are used in the absence of bulk.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients can be clinically or pathologically staged. Splenectomy, liver biopsy, lymph node biopsy, and bone marrow biopsy are mandatory for the establishment of pathological stage. The pathologic stage at a given site is denoted by a subscript (eg, M = bone marrow, H = liver, L = lung, O = bone, P = pleura, and D = skin).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The Ann Arbor staging system with Cotswolds modifications.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Lister TA, Crowther D, Sutcliffe SB, et al, J Clin Oncol 1989; 7:1630.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
