"       <td rowspan=\"3\">",
"        Gross deletion/duplication analysis",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        FISH",
"       </td>",
"       <td rowspan=\"2\">",
"        Submicroscopic deletions and translocations",
"       </td>",
"       <td>",
"        &gt;8 percent",
"       </td>",
"       <td class=\"centered\" rowspan=\"7\">",
"        For a list of available laboratories, please see",
"        <a href=\"file://www.ncbi.nlm.nih.gov/sites/GeneTests/lab/clinical_disease_id/2161?db=genetests\" target=\"_blank\">",
"         GeneTests",
"        </a>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heterozygosity testing",
"       </td>",
"       <td>",
"        8 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MLPA, quantitative multiplex PCR, other methods",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Submicroscopic whole exon(s) deletions, insertions, and rearrangements",
"       </td>",
"       <td>",
"        16 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Mutation scanning",
"       </td>",
"       <td rowspan=\"2\">",
"        Single-base substitutions, small length mutations",
"       </td>",
"       <td rowspan=\"2\">",
"        70 to 75 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Sequence analysis (genomic)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Targeted mutation analysis",
"       </td>",
"       <td>",
"        Specific panel of recurrent point mutations",
"       </td>",
"       <td>",
"        25 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Methylation analysis",
"       </td>",
"       <td>",
"        Hypermethylation of the promoter region",
"       </td>",
"       <td>",
"        10 to 12 percent",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Sequence analysis of RNA from blood",
"       </td>",
"       <td>",
"        (Deep intronic) splice mutations, gross rearrangements",
"       </td>",
"       <td>",
"        &lt;5 percent",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     FISH: fluorescence in situ hybridization; MLPA: multiplex ligation-dependent probe amplification; PCR: polymerase chain reaction; GH: genomic hybridization; CLIA: Clinical Laboratory Improvement Amendments.",
"     <br>",
"      * The ability of the test method used to detect a mutation that is present in the indicated gene.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       In individuals with normal chromosome studies; refers to the ability to detect a germline mutation if one is present.",
"       <br>",
"        &Delta; Test availability refers to availability in the GeneTests Laboratory Directory.",
"        <em>",
"         GeneReviews",
"        </em>",
"        designates a molecular genetic test as clinically available only if the test is listed in the GeneTests Laboratory Directory by either a US CLIA-licensed laboratory or a non-US clinical laboratory. GeneTests does not verify laboratory-submitted information or warrant any aspect of a laboratory's licensure or performance. Clinicians must communicate directly with the laboratories to verify information.",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         Testing that identifies whole-exon deletions/duplications not readily detectable by sequence analysis of genomic DNA; a variety of methods including quantitative PCR, long-range PCR, MLPA, or targeted array GH (gene/segment-specific) may be used. A full array GH analysis that detects deletions/duplications across the genome may also include this gene/segment.",
"         <br>",
"          &sect; In retinoblastoma tumor tissue.",
"          <br>",
"           &yen; In individuals without a mutation identified by DNA-based analyses.",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Lohmann D, Scheffer H, Gaille B. Best practice guidelines for molecular analysis of retinoblastoma. European Molecular Genetics Quality Network 2002.",
"      </li>",
"      <li>",
"       Rushlow D, Piovesan B, Zhang K, et al. Detection of mosaic RB1 mutations in families with retinoblastoma. Hum Mutat 2009; 30:842.",
"      </li>",
"      <li>",
"       Zhang K, Nowak I, Rushlow D, et al. Patterns of missplicing caused by RB1 gene mutations in patients with retinoblastoma and association with phenotypic expression. Hum Mutat 2008; 29:475.",
"      </li>",
"     </ol>",
"     <br/>",
